import React, { useState, useEffect } from "react";

const App = () => {
  const [num, setnum] = useState(0);

  useEffect(() => {
    alert("I am clicked");
    document.title = `You clicked me ${num} times`;
  }, [num]);
  return (
    <button
      onClick={() => {
        setnum(num + 1);
      }}
    >
      Click Me {num}
    </button>
  );
};

export default App;
